using System.Buffers;
using System.Collections.Generic;
using System.Linq;

namespace ChristMoose
{
    internal class Day5
    {
        private static string Input => "";
        private static string TestInput => "dabAcCaCBAcCcaDA";
        private static string alphabet => "abcdefghijklmnopqrstuvwxyz";

        public static int TryExcludingAlphabetz()
        {
            var reactionResults = new List<int>();
            foreach (var letter in alphabet)
            {
                 reactionResults.Add(ReactionWithoutLetter(Input, letter).Length);
            }

            return reactionResults.Min();
        }

        public static string ReactionWithoutLetter(string reactiveMaterial, char letter)
        {
            reactiveMaterial = reactiveMaterial.Replace(letter.ToString(), "");
            reactiveMaterial = reactiveMaterial.Replace(letter.ToString().ToUpper(), "");
            return Reaction(reactiveMaterial);
        }

        public static int GetReaciveMaterialsResults()
        {
            return Reaction(Input).Length;
        }

        public static string Reaction(string reactiveMaterial)
        {
            bool changesFound = true;
            int stringLength = reactiveMaterial.Length;
            while (changesFound)
            {
                changesFound = false;

                for (var index = 0; index + 1 < stringLength; index++)
                {
                    var c = reactiveMaterial[index];
                    var next = reactiveMaterial[index + 1];

                    if (c.ToString().ToUpper() == next.ToString().ToUpper())
                    {
                        if (c != next)
                        {
                            var result = reactiveMaterial.Substring(0, index) + reactiveMaterial.Substring(index + 2);
                            changesFound = true;
                            reactiveMaterial = result;
                            stringLength = reactiveMaterial.Length;
                            break;
                        }
                    }


                }

            }


            return reactiveMaterial;
        }
    }
}